// define a function that checks if string s is a subsequence of string t
function f_gold(s, t) {
    // initialize variables i, j, m, n
    var i, j, m, n;
    [i, j, m, n] = [0, 0, s.length, t.length];
    // iterate through s and t
    while (i < m && j < n) {
        // if the characters match, move to the next character in s
        if (s[i] == t[j]) {
            i += 1;
        }
        // move to the next character in t
        j += 1;
    }
    // if all characters in s have been matched, return true
    return i == m;
}
